    super();

    this.state = {
      inChat: false,
    }
  }

  createGroup() {
    this.setState({
      inChat: true,
    })
  }

  render() {
    return (
      <div>
        <header>
          <p>
            Yummy
          </p>
        </header>
        {
          !this.state.inChat &&
          <div>
            <button>
              Create a Group
            </button>
            <button>
              Join a Group
            </button>
          </div>
        }
        {
          this.state.inChat &&
          <div>hi</div>
        }
      </div>
    )
  }
}

export default App;
